import React from 'react';
import { Link } from 'react-router-dom';

const CompMenu = () => {
  return (
    <section className='menu'>
      <div className="theme">
        테마
      </div>
      <nav>
        <Link to="/calc">CaLC</Link>
        <Link to="/bmi">BmI</Link>
        <Link to="/dday">DdAY</Link>
      </nav>
    </section>
  );
};

export default CompMenu;
